		var movement = "right"; //משתנה המאפשר/מונע תזוזה של המשתמש
		var question = ["עברו רק דרך ראשי המטה הכללי של מדינת ישראל", "עברו רק דרך המצאות ישראליות"]; //ההוראה המרכזית למשחק
