		function handlekeypress(e) { //פונקצייה שמופעלת כאשר לוחצים על מקשי המקלדת
		
			var user = game.getChildByName("user"); //משתנה המכיל את הקריאה לדמות שחקן
		
			if (e.keyCode == 37 && B > 0) { //שמאלה
				user.x -= xJumps; //מזיז שמאלה את דמות השחקן
				B--;
				boxNum--; //מספר משבצת שעליה עומד השחקן
				//console.log("box number " + boxNum);
			} else if (e.keyCode == 38 && A > 0) { //למעלה
				user.y -= yJumps; //מזיז למעלה את דמות השחקן
				A--;
				boxNum -= 5; //מספר משבצת שעליה עומד השחקן
				//console.log("box number " + boxNum);
			} else if (e.keyCode == 39 && B < 4) { //ימינה
				user.x += xJumps; //מזיז ימינה את דמות השחקן
				B++;
				boxNum++; //מספר משבצת שעליה עומד השחקן
				//console.log("box number " + boxNum);
			} else if (e.keyCode == 40 && A < 4) { //למטה
				user.y += yJumps; //מזיז למטה את דמות השחקן
				A++;
				boxNum += 5; //מספר משבצת שעליה עומד השחקן
				//console.log("box number " + boxNum);
			};
			//////////////בדיקה האם השחקן נמצא על משצבת נכונה//////////////////
			if (mazeWay7[changeMazeWay][A][B] == "O") { //משבצת נכונה
				movement = "right";
				if (soundOn == true) { //אם הסאונד פועל
					var instance = createjs.Sound.play("YES"); //השמעת הצליל למשוב חיובי
				}
				rightOrWrong(); //הפעלת הפונקציה לאנימציה פנימית למשוב חיובי
			} else if (mazeWay7[changeMazeWay][A][B] == "X") { //משבצת לא נכונה
				movement = "wrong";
				if (soundOn == true) { //אם הסאונד פועל
					var instance = createjs.Sound.play("NO"); //השמעת הצליל למשוב שלילי
				}
				mistakes++; //משתנה המכיל את מספר הטעויות של המשתמש מתחילת המשחק
				rightOrWrong(); //הפעלת הפונקציה לאנימציה פנימית למשוב שלילי
				endFeadbackArr.push(endArr[boxNum]); //התוכן שבתוך המשבצת שנבחרה לא נכון נכנס לתוך מערך משוב מאבחן
				console.log(endFeadbackArr);
		
			} else if (mazeWay7[changeMazeWay][A][B] == "end") { //אם השחקן הגיע לסוף
				movement = "right"; //משוב חיובי של תזוזה
				window.removeEventListener("keydown", handlekeypress); //המקשים לא מופעלים
				game.getChildByName("box" + boxNum).gotoAndPlay(21); //הרצת אנימציה של הבהוב ירוק מסביב למסגרת המלבן
				setTimeout(function () { //טימר שיפעל אחרי שנייה
					endingAnimation(); //פונקציה המציגה את אנימציית סיום
				}, 1000);
			};
		}
		
		function rightOrWrong() { //פונקציה המספקת משוב לתזוזות השחקן
			if (movement == "wrong") { //אם השחקן על משבצת לא נכונה
				game.getChildByName("box" + boxNum).gotoAndPlay(2); //אז המסגרת של המשבצת עליה הוא עומד תצבע באדום
				window.removeEventListener("keydown", handlekeypress); //המקשים לא מופעלים
				setTimeout(function () { //טימר שיפעל אחרי שנייה
					restartGame(); //פונקציה שמאתחלת את המשחק
				}, 1000);
			} else if (movement == "right") { //אם השחקן נמצא על משבצת נכונה
				game.getChildByName("box" + boxNum).gotoAndStop(1); //אז המסגרת של המשבצת עליה הוא עומד תצבע בירוק
			}
		}
		
